import { Dialog, DialogContent, DialogTitle } from '@material-ui/core';
import React from 'react'

const theme = createTheme({
    palette: {
      success: {
        // Purple and green play nicely together.
        main: '#2e7d32',
        light: '#4caf50',
        dark: '#1b5e20',
        contrastText: '#fff',
      },
      error: {
        // This is green.A700 as hex.
        main: '#f44336',
      },
      wurst: {
        // Purple and green play nicely together.
        main: '#2e7d32',
        light: '#4caf50',
        dark: '#1b5e20',
        contrastText: '#fff',
      },
    },
  });

export default function UpdateUserPopup(props) {

    const { title, children, openPopup, setOpenPopup } = props;

    return (
        <Dialog open={openPopup}>
            <DialogTitle >
            <div>Update User</div>
            </DialogTitle>
            <DialogContent>
            <div>Are you sure about your update? All Entities would be overwritten</div>
                {children}
            </DialogContent>
        </Dialog>
    )
}
